import React from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";
const NavBar = ({ UI }) => {
  const navList = ["About", "Projects", "Resume", "Contact"];
  const renderedNavList = navList.map((index) => {
    return <Card fs={"0.7rem"}>{index}</Card>;
  });
  return (
    <Card
      mg={"1rem 7.5%"}
      height={"2rem"}
      width={"85%"}
      bd={"1px solid red"}
      dp={"grid"}
      gridC={"28% 35% 37%"}
      //   ovfx={"hidden"}
    >
      <Card bd={"0px solid red"}>
        <ImageCard
          src={UI.userIcon}
          heigth={"80%"}
          width={"1.6rem"}
          mg={"0rem 0rem -0.5rem 0rem"}
        />
        <Card
          fs={"0.8rem"}
          fw={"700"}
          ps={"relative"}
          pstp={"0.4rem"}
          mg={"0rem 0.5rem"}
          dp={"inline"}
        >
          Marvel
        </Card>
      </Card>
      <Card>
        <Card
          mg={"1rem 0 0 0"}
          dp={"grid"}
          gridC={"auto auto auto auto"}
          bd={"0px solid red"}
        >
          {renderedNavList}
        </Card>
      </Card>
      <Card height={"2rem"} width={"5rem"} bd={"1px solid red"}>
        <Card height={"100%"} width={"100%"}>
          <ImageCard height={"100%"} width={"100%"} src={UI.moonIcon} />
        </Card>
      </Card>
    </Card>
  );
};

export default NavBar;
